import * as S from './styles';

interface ModalStatusButtonsProps {
  status: string;
  handleChangeStatus: (newStatus: '판매중' | '예약중' | '판매완료') => void;
}

export const ModalStatusButtons = ({ status, handleChangeStatus }) => {
  switch (status) {
    case '판매중':
      return (
        <>
          <S.ModalBtn onClick={() => handleChangeStatus('예약중')}>
            <span>예약중으로 변경</span>
          </S.ModalBtn>
          <S.ModalBtn onClick={() => handleChangeStatus('판매완료')}>
            <span>판매완료로 변경</span>
          </S.ModalBtn>
        </>
      );
    case '예약중':
      return (
        <>
          <S.ModalBtn onClick={() => handleChangeStatus('판매중')}>
            <span>판매중으로 변경</span>
          </S.ModalBtn>
          <S.ModalBtn onClick={() => handleChangeStatus('판매완료')}>
            <span>판매완료로 변경</span>
          </S.ModalBtn>
        </>
      );
    case '판매완료':
      return (
        <>
          <S.ModalBtn onClick={() => handleChangeStatus('판매중')}>
            <span>판매중으로 변경</span>
          </S.ModalBtn>
          <S.ModalBtn onClick={() => handleChangeStatus('예약중')}>
            <span>예약중으로 변경</span>
          </S.ModalBtn>
        </>
      );
  }
};
